import React from 'react'
import { Channel, Feed } from '../interfaces/ClimateInterface';
import { Text, View } from 'react-native';
import { styles } from '../theme/appTheme';


interface ClimateDataProps { 
    channel: Channel;
    feeds: Feed
}

export const ClimateData = ({channel, feeds}: ClimateDataProps) => {
    return (
        <View style = {styles.globalMargin}> 
            <View style = {styles.channelData}>
                <Text style={styles.title}>{channel.name}</Text>
                <Text style={styles.title}>{channel.description}</Text>
                <Text style={styles.title}>Latitud: {channel.latitude}</Text>
                <Text style={styles.title}>Longitud: {channel.longitude}</Text>
            </View>
            <View style = {styles.feedData}>
                <Text style={styles.title}>id: {feeds.entry_id} </Text>
                <Text style={styles.title}>{channel.field1}:{feeds.field1}</Text> 
                <Text style={styles.title}>{feeds.field2}</Text>
                <Text style={styles.title}>{feeds.field3}</Text>
                <Text style={styles.title}>{feeds.field4}</Text>
                <Text style={styles.title}>{feeds.field5}</Text>
                <Text style={styles.title}>{feeds.field6}</Text>
            </View>
        </View>
    )
}
